import { useState } from 'react';
import React from 'react';
import * as style from './styles';

export default function ReactionTimeTest() {
  const red = 'rgb(206, 38, 54)';
  const green = 'rgb(75, 219, 106)';
  const blue = 'rgb(43, 135, 209)';
  const [color, setColor] = useState(blue);

  const changeToGreen = () => {
    setTimeout(() => {
      setColor(green);
    }, 1000);
  };

  const handleClick = () => {
    console.log(color);
    if (color === 'blue') {
      console.log(color, 1);
      setColor(red);
      changeToGreen();
    } else if (color === 'red') {
      console.log(color, 2);
      setColor(blue);
    } else {
      console.log(color, 3);
      // if green
      setColor(blue); // to blue
    }
  };

  return (
    <style.Container
      onClick={() => handleClick()}
      style={{ backgroundColor: color }}
    ></style.Container>
  );
}
